		<guid isPermaLink="false">http://bvcmsblog.wordpress.com/?p=1198</guid>
		<description><![CDATA[If you have ever looked at the people record for a deceased person in your database, you know that we display their name in the header (AKA the business card section) with a red block around the name. This catches your eye, so that you immediately see that the person is deceased. We also display [&#8230;]<img alt="" border="0" src="http://pixel.wp.com/b.gif?host=blog.bvcms.com&#038;blog=32746407&#038;post=1198&#038;subd=bvcmsblog&#038;ref=&#038;feed=1" width="1" height="1" />]]></description>
				<content:encoded><![CDATA[<p>If you have ever looked at the people record for a deceased person in your database, you know that we display their name in the header (AKA the business card section) with a red block around the name. This catches your eye, so that you immediately see that the person is deceased. We also display the deceased date in red text.</p>
<p>Now, if you are viewing the people record of any family member of a deceased person, you can see at a glance that a family member is deceased. We are now displaying that deceased person’s name in red in the Family Members list (on the right side when viewing a person’s record).</p>
<p>We think that adding this visual aid in the Family List will be helpful to you as you minister to families within your church.</p><br />Filed under: <a href=''''http://blog.bvcms.com/category/new-features/''''>new features</a>  <a rel="nofollow" href="http://feeds.wordpress.com/1.0/gocomments/bvcmsblog.wordpress.com/1198/"><img alt="" border="0" src="http://feeds.wordpres'', N''Q1w6eO0Vnt9tcHKCkUnjEE0OgIg'', ''2014-07-17 05:14:26.000'')')
