		<title>Problems with the Address Matching System on June 26</title>
		<link>http://blog.bvcms.com/2014/06/26/problems-with-the-address-matching-system-on-june-26/</link>
		<comments>http://blog.bvcms.com/2014/06/26/problems-with-the-address-matching-system-on-june-26/#comments</comments>
		<pubDate>Thu, 26 Jun 2014 22:47:57 +0000</pubDate>
		<dc:creator><![CDATA[David]]></dc:creator>
				<category><![CDATA[bug fix]]></category>
		<category><![CDATA[Explaining]]></category>

		<guid isPermaLink="false">http://bvcmsblog.wordpress.com/?p=1195</guid>
		<description><![CDATA[For those of you who may have experienced problems with entering addresses on Thursday, we want to inform you that we worked on it all day long!  It is now fixed. For those of you interested in the gory details—there were two problems: The original problem was an old file that expired yesterday. But we [&#8230;]<img alt="" border="0" src="http://pixel.wp.com/b.gif?host=blog.bvcms.com&#038;blog=32746407&#038;post=1195&#038;subd=bvcmsblog&#038;ref=&#038;feed=1" width="1" height="1" />]]></description>
				<content:encoded><![CDATA[<p>For those of you who may have experienced problems with entering addresses on Thursday, we want to inform you that we worked on it all day long! </p>
<p><strong>It is now fixed.</strong></p>
<p>For those of you interested in the gory details—there were two problems:</p>
<ol>
<li>The original problem was an old file that expired yesterday. But we did not know this until later in the day. </li>
<li>The second and more pernicious problem was one we created as we were trying to figure out the first problem. Then after we figured out the first problem, this second problem was causing problems that was masking our understanding of the first problem. </li>
</ol>
<p>After finally talking with a programmer at USPS late in the day, we got a clue about the second problem that we caused earlier today. Which meant we had two problems but were only looking for one. The problem we caused today while working on this, was that we deleted a configuration file that had customer keys in it. Furthermore, the system was automatically creating the file again, but without the keys. Once we figured that out, we restored it from the recycle bin and everything started working again because we had already solved the original problem. </p>
<p>The remainder of the issues were that my work arounds did not really work either. So all is well but we learned a lesson about our Address Matching system that has been working fine for 5 years with no problems. We need to have a graceful fallback if it ever stops working like it did last night.</p>
<p>So sorry for any trouble this may have caused you.</p><br />Filed under: <a href=''''http://blog.bvcms.com/category/bug-fix/''''>bug fix</a>, <a href=''''http://blog.bvcms.com/category/explaining/''''>Explaining</a>  <a rel="nofollow" href="http://feeds.wordpress.com/1.0/gocomments/bvcmsblog.wordpress.com/1195/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/comments/bvcmsblog.wordpress.com/1195/" /></a> <img alt="" border="0" src="http://pixel.wp.com/b.gif?host=blog.bvcms.com&#038;blog=32746407&#038;post=1195&#038;subd=bvcmsblog&#038;ref=&#038;feed=1" width="1" height="1" />]]></content:encoded>
