		<description><![CDATA[Scenario: You had an online registration with a fee and allowed the registrants to pay a deposit. Now it’s time to remind everyone to pay off the balance, but you know that many of them will not be able to find their email confirmation with the paylink.  Solution: Email the members directly from the toolbar [&#8230;]<img alt="" border="0" src="http://pixel.wp.com/b.gif?host=blog.bvcms.com&#038;blog=32746407&#038;post=1193&#038;subd=bvcmsblog&#038;ref=&#038;feed=1" width="1" height="1" />]]></description>
				<content:encoded><![CDATA[<h2>Scenario:</h2>
<p>You had an <strong>online registration with a fee</strong> and allowed the registrants to pay a <strong>deposit</strong>. Now it’s time to remind everyone to <strong>pay off the balance</strong>, but you know that many of them will not be able to find their email confirmation with the paylink. </p>
<h2>Solution:</h2>
<p><strong>Email</strong> the members directly <strong>from the toolbar on the organization</strong> and use any or all of the new <strong>email replacement codes</strong>:</p>
<ul>
<li>{paylink}</li>
<li>{amount}</li>
<li>{amtpaid}</li>
<li>{amtdue}</li>
</ul>
<h3><a href="http://www.bvcms.com/Doc/EmailReplacements">Learn more</a> </h3>
<p>(see Use Case #2 in the section for Special Use Cases for Regular Emails)</p><br />Filed under: <a href=''''http://blog.bvcms.com/category/new-features/''''>new features</a>  <a rel="nofollow" href="http://feeds.wordpress.com/1.0/gocomments/bvcmsblog.wordpress.com/1193/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/comments/bvcmsblog.wordpress.com/1193/" /></a> <img alt="" border="0" src="http://pixel.wp.com/b.gif?host=blog.bvcms.com&#038;blog=32746407&#038;post=1193&#038;subd=bvcmsblog&#038;ref=&#038;feed=1" width="1" height="1" />]]></content:encoded>
