				<category><![CDATA[new features]]></category>

		<guid isPermaLink="false">http://bvcmsblog.wordpress.com/?p=1191</guid>
		<description><![CDATA[You need to check out the newest version of the Enrollment Control Report for iPhone / iPad! It is so much and easier and faster. Now, instead of tapping the first letter of the last  name of the person you are looking for, you just find the button with the appropriate first 2 letters of [&#8230;]<img alt="" border="0" src="http://pixel.wp.com/b.gif?host=blog.bvcms.com&#038;blog=32746407&#038;post=1191&#038;subd=bvcmsblog&#038;ref=&#038;'',NULL,NULL) WHERE [Url]=N''http://feeds.feedburner.com/BvcmsBlog''
UPDATE [dbo].[RssFeed] SET [Data].WRITE(N''feed=1" width="1" height="1" />]]></description>
				<content:encoded><![CDATA[<p>You need to check out the newest version of the <strong>Enrollment Control Report for iPhone / iPad</strong>! It is so much and easier and faster. Now, instead of tapping the first letter of the last  name of the person you are looking for, you just find the button with the appropriate first 2 letters of their last name. Click the button to see only those who last names begin with those 2 letters. This has removed much of the scrolling that was necessary if you had a very large group of names.</p>
<p><img style="display:block;margin-left:auto;margin-right:auto;" title="iPadEnrCntrlRpt.png" src="https://bvcmsblog.files.wordpress.com/2014/06/ipadenrcntrlrpt.png?w=600&#038;h=185" alt="IPadEnrCntrlRpt" width="600" height="185" border="0" /></p>
<p>Why did we make this change when we did? Yesterday was the first day of our church’s VBS, and we have over 3,000 people who attend each day. You can imagine how many parents might forget to bring their child’s room assignment email with them. Which means that there are quite a few people who need help knowing to which class their child has been assigned.</p>
<p>BVCMS has the bonus of having a developer that actually uses the product in real situations &#8211; such as day one of a huge VBS! When we realized that, at least for our church, there was a lot of scrolling involved to use the iPhone / iPad Enrollment Control Report, David decided he could make it better. Which is exactly what he did! </p>
<p>I LOVE this new enhancement and I know you will too! And, by the way, this is not just used for Vacation Bible School. It is especially helpful on Promotion Sunday as well.</p>
<h3><a href="http://www.bvcms.com/Doc/_EnrollmentControlReportiPhoneiPad">Learn more</a>.</h3><br />Filed under: <a href=''''http://blog.bvcms.com/category/new-features/''''>new features</a>  <a rel="nofollow" href="http://feeds.wordpress.com/1.0/gocomments/bvcmsblog.wordpress.com/1191/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/comments/bvcmsblog.wordpress.com/1191/" /></a> <img alt="" border="0" src="http://pixel.wp.com/b.gif?host=blog.bvcms.com&#038;blog=32746407&#038;post=1191&#038;subd=bvcmsblog&#038;ref=&#038;feed=1" width="1" height="1" />]]></content:encoded>
			<wfw:commentRss>http://blog.bvcms.com/2014/06/10/faster-and-easier-to-use-enrollment-control-report-for-iphoneipad/feed/</wfw:commentRss>
