		<description><![CDATA[We just added 3 new replacement codes that can be used in emails sent from search builder. They are as follows: {orgmember:orgname,divid} {orgmember:leader,divid} {orgmember:location,divid} In each of these, you would replace divid with the ID # for the Division. One use case would be for Vacation Bible School. You build a search to find everyone [&#8230;]<img alt="" border="0" src="http://pixel.wp.com/b.gif?host=blog.bvcms.com&#038;blog=32746407&#038;post=1188&#038;subd=bvcmsblog&#038;ref=&#038;feed=1" width="1" height="1" />]]></description>
				<content:encoded><![CDATA[<p>We just added <strong>3 new replace'',NULL,NULL) WHERE [Url]=N''http://feeds.feedburner.com/BvcmsBlog''
UPDATE [dbo].[RssFeed] SET [Data].WRITE(N''ment codes</strong> that can be used in emails sent from search builder. They are as follows:</p>
<blockquote>
<p>{orgmember:orgname,divid}</p>
<p>{orgmember:leader,divid}</p>
<p>{orgmember:location,divid}</p>
</blockquote>
<p>In each of these, you would replace <strong>divid</strong> with the <strong>ID # for the Division</strong>.</p>
<p>One use case would be for Vacation Bible School. You build a search to find everyone who is enrolled in the same Program and Division (but in different classes), and then send an email to everyone giving them the name of the <strong>organization name</strong> (class), the <strong>leader</strong>, and/or the <strong>location</strong> of the organization in which they are enrolled. Of course, if you move people into classes using Org Members Management, there is a feature there for you to send a system-built email with all of that information.</p>
<p>However, you may not want to include all 3 items. So, this is a perfect solution. Also, even if you have already sent the email room notices, these new codes allow you to send one reminder to everyone that will give them their individual room information. NOTE: Be sure everyone is enrolled in only one class within that Program and Division.</p>
<p><img style="display:block;margin-left:auto;margin-right:auto;" title="EmailReplacementCodes.png" src="https://bvcmsblog.files.wordpress.com/2014/06/emailreplacementcodes.png?w=600&#038;h=443" alt="EmailReplacementCodes" width="600" height="443" border="0" /></p>
<p>We have included information about these codes in a section name <strong>Special Use Case for Regular Emails </strong>in the Email Replacement Codes help article.</p>
<h3><a href="http://www.bvcms.com/Doc/EmailReplacements">Learn more</a></h3><br />Filed under: <a href=''''http://blog.bvcms.com/category/uncategorized/''''>Uncategorized</a>  <a rel="nofollow" href="http://feeds.wordpress.com/1.0/gocomments/bvcmsblog.wordpress.com/1188/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/comments/bvcmsblog.wordpress.com/1188/" /></a> <img alt="" border="0" src="http://pixel.wp.com/b.gif?host=blog.bvcms.com&#038;blog=32746407&#038;post=1188&#038;subd=bvcmsblog&#038;ref=&#038;feed=1" width="1" height="1" />]]></content:encoded>
