		<title>Feature for Re-Sending an Email to a New Group</title>
		<link>http://blog.bvcms.com/2014/05/28/feature-for-re-sending-an-email-to-a-new-group/</link>
		<comments>http://blog.bvcms.com/2014/05/28/feature-for-re-sending-an-email-to-a-new-group/#comments</comments>
		<pubDate>Wed, 28 May 2014 10:56:55 +0000</pubDate>
		<dc:creator><![CDATA[Karen]]></dc:creator>
				<category><![CDATA[new features]]></category>

		<guid isPermaLink="false">http://bvcmsblog.wordpress.com/?p=1182</guid>
		<description><![CDATA[Do you ever need to send a previously sent email to a different group of recipients, but you did not save it as a draft? Sometimes, it might just need to go to one or two more people, other times, to another larger group. Regardless of how many need to receive the email, you want [&#8230;]<img alt="" border="0" src="http://pixel.wp.com/b.gif?host=blog.bvcms.com&#038;blog=32746407&#038;post=1182&#038;subd=bvcmsblog&#038;ref=&#038;feed=1" width="1" height="1" />]]></description>
				<content:encoded><![CDATA[<p>Do you ever need to <strong>send a previously sent email to a different group of recipients</strong>, but you did not save it as a draft? Sometimes, it might just need to go to one or two more people, other times, to another larger group. Regardless of how many need to receive the email, you want them to receive the same nice-looking email you composed originally.</p>
<p>We have the solution for you! It revolves around a little <strong>link on the <strong><em>Email Details</em> page</strong></strong> that you may have overlooked<strong> - Email Content: <em>View HTML Source</em></strong>.</p>
<p>Using this little link (and copying and pasting) has saved me so much time by giving me a very simple way to take a nicely-done email and send it to another group of people, <strong>without losing any of the formatting</strong>. Check it out! You may find this helpful, too.</p>
<p><a href="http://www.bvcms.com/Doc/_Emails_Details">Learn more</a>.</p><br />Filed under: <a href=''''http://blog.bvcms.com/category/new-features/''''>new features</a>  <a rel="nofollow" href="http://feeds.wordpress.com/1.0/gocomments/bvcmsblog.wordpress.com/1182/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/comments/bvcmsblog.wordpress.com/1182/" /></a> <img alt="" border="0" src="http://pixel.wp.com/b.gif?host=blog.bvcms.com&#038;blog=32746407&#038;post=1182&#038;'',NULL,NULL) WHERE [Url]=N''http://feeds.feedburner.com/BvcmsBlog''
