		<guid isPermaLink="false">http://bvcmsblog.wordpress.com/?p=1180</guid>
		<description><![CDATA[We recently completed a very special type of online registration designed specifically to benefit mission trip participants (Goers), mission trip supporters (Senders), and the staff or lay leaders who are the administrators for those trips. Here are some basics premises relating to this type of registration that you need to understand before going any further: This is an online [&#8230;]<img alt="" border="0" src="http://pixel.wp.com/b.gif?host=blog.bvcms.com&#038;blog=32746407&#038;post=1180&#038;subd=bvcmsblog&#038;ref=&#038;feed=1" width="1" height="1" />]]></description>
				<content:encoded><![CDATA[<p>We recently completed a very special type of online registration designed specifically to benefit<strong> </strong><strong>mission trip</strong> <strong>participants (<span style="text-decoration:underline;">G<span><em>oers</em></span></span>)</strong>, mission trip <strong>supporters (<span style="text-decoration:underline;">S<span><em>enders</em></span></span>)</strong>,<strong> </strong>and the <strong>staff</strong> or <strong>lay leaders </strong>who are the administrators for those trips. Here are some basics premises relating to this type of registration that you need to understand before going any further:</p>
<ul>
<li>This is an <strong>online registration feature</strong>, so it works best when <strong>fees and donations</strong> are made <strong>online using credit card or ACH transactions</strong>. </li>
<li>This is also a feature for the behavior of how members of the organization are managed as well. There are <strong>special small group designations </strong>(<strong>Goer</strong> and <strong>Sender</strong>) and ways to enter checks and cash for Senders.</li>
<li>Every <strong>fee</strong> paid by the <strong>registrant</strong> (the G<em>oer</em>) is automatically recorded as a <strong>tax-deductible donation.</strong></li>
<li>Every <strong>donation</strong> made by a <strong>supporter</strong> (the S<em>ender</em>) is recorded as a <strong>tax-deductible donation.</strong></li>
<li>A <strong>Donation</strong> from a S<em>ender </em>is paired with the G<em>oer</em> and <strong>reduces the goer&#8217;s balance</strong>.</li>
<li>Registrants can <strong>monitor their balance </strong>at any time.</li>
<li>Registrants can <strong>use BVCMS to send potential supporters an email </strong>containing a <strong>register link</strong> making it so easy for the sender to donate online.</li>
<li>Supporters can also be directed to a giving page using a link posted on Facebook or somewhere else. However, the previously-mentioned method with a register link in a supporter request email is much more convenient for the donor, since they don’t have to find their record or login (they will already be logged in when they click the link in the email). With the Facebook link, they would not have the convenience.</li>
</ul>
<p>There is a lot more related to this type of registration. So if your church sends people on mission trips, you will want to check out this wonderful n'',NULL,NULL) WHERE [Url]=N''http://feeds.feedburner.com/BvcmsBlog''
UPDATE [dbo].[RssFeed] SET [Data].WRITE(N''ew online feature!</p>
<p><a href="http://www.bvcms.com/Doc/MissionTripRegistration">Learn more</a></p>
<p><img style="display:block;margin-left:auto;margin-right:auto;" title="MissionTrip.png" src="https://bvcmsblog.files.wordpress.com/2014/05/missiontrip.png?w=600&#038;h=479" alt="MissionTrip" width="600" height="479" border="0" /></p><br />Filed under: <a href=''''http://blog.bvcms.com/category/new-features/''''>new features</a>  <a rel="nofollow" href="http://feeds.wordpress.com/1.0/gocomments/bvcmsblog.wordpress.com/1180/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/comments/bvcmsblog.wordpress.com/1180/" /></a> <img alt="" border="0" src="http://pixel.wp.com/b.gif?host=blog.bvcms.com&#038;blog=32746407&#038;post=1180&#038;subd=bvcmsblog&#038;ref=&#038;feed=1" width="1" height="1" />]]></content:encoded>
