		<item>
		<title>Status Flags – Protected by Role</title>
		<link>http://blog.bvcms.com/2014/05/21/status-flags-protected-by-role/</link>
		<comments>http://blog.bvcms.com/2014/05/21/status-flags-protected-by-role/#comments</comments>
		<pubDate>Wed, 21 May 2014 11:48:28 +0000</pubDate>
		<dc:creator><![CDATA[Karen]]></dc:creator>
				<category><![CDATA[new features]]></category>

		<guid isPermaLink="false">http://bvcmsblog.wordpress.com/?p=1177</guid>
		<description><![CDATA[Status Flags have many uses and can now be protected with a special user role, so that only certain users can see them. All Status Flags start as searches that are saved using a special naming convention, and these searches are automatically run every morning at 4:30 to find everyone who fits that search. A brief description [&#8230;]<img alt="" border="0" src="http://pixel.wp.com/b.gif?host=blog.bvcms.com&#038;blog=32746407&#038;post=1177&#038;subd=bvcmsblog&#038;ref=&#038;feed=1" width="1" height="1" />]]></description>
				<content:encoded><![CDATA[<p>Status Flags have many uses and can now be <strong>protected with a special user role, </strong>so that only certain users can see them. All Status Flags start as <strong>searches</strong> that are saved using a special naming convention, and these searches are automatically run every morning at 4:30 to find everyone who fits that search.</p>
<p>A brief description of where you find Status Flags:</p>
<ul>
<li>Status Flags display (using the name of the saved search) on <strong>people records </strong>under the membership information on the <strong>Profile &gt; Member tab</strong>.</li>
<li>Status Flags also display on the top portion of the people record as<strong> badges</strong>, if your church is using this feature.</li>
<li>The <strong>People Search page</strong> has a <strong>filter</strong> for Status Flags, so you can quickly find those with specific flags.</li>
<li>There is also a <strong>condition in Search Builder</strong> to allow you to search by one or more Status Flags.</li>
<li>The <strong>Status Flag Export</strong>, which can be run for any group of people wherever you see the blue toolbar, is another tool for using Status Flags.</li>
</ul>
<p>Now, that we have briefly touched on Status Flags &#8211; what they are and where you find them, I want to tell you about another feature of Status Flags.</p>
<p>You can <strong>protect any Status Flag with a user role</strong> that is tied directly to <strong>that specific Status Flag</strong>. This ensures that <em>only users with that role</em> will be able to see that a person '',NULL,NULL) WHERE [Url]=N''http://feeds.feedburner.com/BvcmsBlog''
UPDATE [dbo].[RssFeed] SET [Data].WRITE(N''has that Status Flag. If you want to protect more than one Status Flag, you would create multiple roles &#8211; one role for each protected Status Flag.</p>
<p>Examples:</p>
<p>You may want to identify those who are donors to your church, but you would, of course, not want everyone seeing that flag.</p>
<p>Or, you may want to create a search for those formerly active members of your church whose attendance is dropping. You would not want every user to see that either.</p>
<h3><a href="http://www.bvcms.com/Doc/ProtectedStatusFlags">Learn more</a>..</h3>
<p><span style="font-size:1.17em;"> </span></p><br />Filed under: <a href=''''http://blog.bvcms.com/category/new-features/''''>new features</a>  <a rel="nofollow" href="http://feeds.wordpress.com/1.0/gocomments/bvcmsblog.wordpress.com/1177/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/comments/bvcmsblog.wordpress.com/1177/" /></a> <img alt="" border="0" src="http://pixel.wp.com/b.gif?host=blog.bvcms.com&#038;blog=32746407&#038;post=1177&#038;subd=bvcmsblog&#038;ref=&#038;feed=1" width="1" height="1" />]]></content:encoded>
