				<content:encoded><![CDATA[<p>We have added another <strong>Convert to Search</strong> link in BVCMS. You may have noticed it already. It is on the <strong>Email Details</strong> page and will take you to a search for all the recipients of that email. That is quite helpful if you want to send a followup email to that same group of people.</p>
<p>Some of you may not realize that by <strong>clicking the subject of an emai</strong>l you will see more details about that email. We call that the Email Details page. You have this option whether you are viewing emails in the list on a person’s individual record or viewing the entire list of emails sent by your church via BVCMS.</p>
<p>There are a number of very helpful items that are on that details page. This new Convert to Search feature is just one them. </p>
<p><a href="http://www.bvcms.com/Doc/_Emails_Details">Learn more</a>..</p>
