		<item>
		<title>Spell Check in BVCMS Emails</title>
		<link>http://blog.bvcms.com/2014/05/13/spell-check-in-bvcms-emails/</link>
		<comments>http://blog.bvcms.com/2014/05/13/spell-check-in-bvcms-emails/#comments</comments>
		<pubDate>Tue, 13 May 2014 20:42:50 +0000</pubDate>
		<dc:creator><![CDATA[Karen]]></dc:creator>
				<category><![CDATA[Explaining]]></category>

		<guid isPermaLink="false">http://bvcmsblog.wordpress.com/?p=1172</guid>
		<description><![CDATA[CKEditor is the product we use for creating and editing the body of emails in BVCMS. Many of you depend on the spell check feature in order to ensure you do not send out emails with mistakes. If you are one of these users (I am!), you may have noticed that part of this function [&#8230;]<img alt="" border="0" src="http://pixel.wp.com/b.gif?host=blog.bvcms.com&#038;blog=32746407&#038;post=1172&#038;subd=bvcmsblog&#038;ref=&#038;feed=1" width="1" height="1" />]]></description>
				<content:encoded><![CDATA[<p><strong>CKEditor</strong> is the product we use for <strong>creating and editing the body of emails</strong> in BVCMS. Many of you depend on the spell check feature in order to ensure you do not send out emails with mistakes. If you are one of these users (I am!), you may have noticed that part of this function is not working. </p>
<p>The problem is with the third party company that CKEditor uses to do spell checking. That product is free, because it works with advertising. </p>
<p>However, you can still <strong>click the spell check icon </strong>and <strong>Enable SCAYT </strong>(spell check as you type). That should suffice for now. Even though it says it says ‘as you type’ it still <strong>checks the entire document</strong> (in case you do not enable this until <em>after</em> you have typed your email) and puts the <strong>red squiggly line under potentially misspelled words</strong>. When you see that, you can <strong>right-click</strong> and see their <strong>suggestions</strong>.</p>
<p>If you have never used this feature, see the image of the toolbar below. Notice the ABC with the check under it. Click that and then select Enable SCAYT.</p>
<p><img style="display:block;margin-left:auto;margin-right:auto;" title="EnableSCAYT.png" src="https://bvcmsblog.files.wordpress.com/2014/05/enablescayt.png?w=600&#038;h=100" alt="EnableSCAYT" width="600" height="100" border="0" /></p><br />Filed under: <a href=''''http://blog.bvcms.com/category/explaining/''''>Explaining</a>  <a rel="nofollow" href="http://feeds.wordpress.com/1.0/gocomments/bvcmsblog.wordpress.com/1172/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/comments/bvcmsblog.wordpress.com/1172/" /></a> <img alt="" border="0" src="http://pixel.wp.com/b.gif?host=blog.bvcms.com&#038;blog=32746407&#038;post=1172&#038;subd=bvcmsblog&#038;ref=&#038;feed=1" width="1" height="1" />]]></content:encoded>
			<wfw:commentRss>http://blog.bvcms.com/2014/05/13/spell-check-in-bvcms-emails/feed/</wfw:commentRss>
		<slash:comments>0</slash:comments>
	
