				<content:encoded><![CDATA[<p>Do have you <strong>groups that meet off-campus</strong> and whose leaders are responsible for <strong>entering the attendance</strong> for their classes? If so, do you ever find that those leaders sometimes need some gentle <strong><em>prompting</em></s'',NULL,NULL) WHERE [Url]=N''http://feeds.feedburner.com/BvcmsBlog''
UPDATE [dbo].[RssFeed] SET [Data].WRITE(N''trong> to get that done?</p>
<p>If you answered “yes&#8221; to those questions, this new condition is just what you need! Even if you did not answer “yes&#8221; you may still want to use this condition. Once you run the search, you can <strong>email those leaders</strong> in the results reminding them to enter their attendance.</p>
