		<item>
		<title>Bvcms not affected by Heartbleed security bug</title>
		<link>http://blog.bvcms.com/2014/04/10/bvcms-not-affected-by-heartbleed-security-bug/</link>
		<comments>http://blog.bvcms.com/2014/04/10/bvcms-not-affected-by-heartbleed-security-bug/#comments</comments>
		<pubDate>Thu, 10 Apr 2014 12:01:00 +0000</pubDate>
		<dc:creator><![CDATA[David]]></dc:creator>
				<category><![CDATA[Uncategorized]]></category>

		<guid isPermaLink="false">http://bvcmsblog.wordpress.com/?p=1165</guid>
		<description><![CDATA[You may have heard about the serious Internet security flaw that was in the news this week called heartbleed. Here is another news article. Just wanted to let you know that your data at bvcms.com was unaffected by this vulnerability. Here are the results of a test we ran against our servers: Filed under: Uncategorized<img alt="" border="0" src="http://pixel.wp.com/b.gif?host=blog.bvcms.com&#038;blog=32746407&#038;post=1165&#038;subd=bvcmsblog&#038;ref=&#038;feed=1" width="1" height="1" />]]></description>
				<content:encoded><![CDATA[<p>You may have heard about the serious Internet security flaw that was in the news this week called <a href="http://i.imgur.com/RinP94R.png">heartbleed</a>. <a href="http://www.cnet.com/news/heartbleed-bug-undoes-web-encryption-reveals-user-passwords/">Here is another news article</a>.</p>
<p>Just wanted to let you know that your data at bvcms.com was unaffected by this vulnerability. Here are the results of a test we ran against our servers:</p>
<p><img src="http://i.imgur.com/RinP94R.png" alt="" title="" border="0" width="" height="" /></p><br />Filed under: <a href=''''http://blog.bvcms.com/category/uncategorized/''''>Uncategorized</a>  <a rel="nofollow" href="http://feeds.wordpress.com/1.0/gocomments/bvcmsblog.wordpress.com/1165/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/comments/bvcmsblog.wordpress.com/1165/" /></a> <img alt="" border="0" src="http://pixel.wp.com/b.gif?host=blog.bvcms.com&#038;blog=32746407&#038;post=1165&#038;subd=bvcmsblog&#038;ref=&#038;feed=1" width="1" height="1" />]]></content:encoded>
			<wfw:commentRss>http://blog.bvcms.com/2014/04/10/bvcms-not-affected-by-heartbleed-security-bug/feed/</wfw:commentRss>
		<slash:comments>0</slash:comments>
	
		<media:content url="http://2.gravatar.com/avatar/53643a646e578950c22d5f87f2a34302?s=96&amp;d=identicon&amp;r=G" medium="image">
