		<title>UPDATE: Yahoo Mail problems</title>
		<link>http://blog.bvcms.com/2014/04/09/update-yahoo-mail-problems/</link>
		<comments>http://blog.bvcms.com/2014/04/09/update-yahoo-mail-problems/#comments</comments>
		<pubDate>Wed, 09 Apr 2014 12:58:33 +0000</pubDate>
		<dc:creator><![CDATA[David]]></dc:creator>
				<category><![CDATA[Changes]]></category>
		<category><![CDATA[Explaining]]></category>

		<guid isPermaLink="false">http://bvcmsblog.wordpress.com/?p=1163</guid>
		<description><![CDATA[We have taken steps to improve deliverability for your emails to and from yahoo.com. This was published yesterday afternoon and so far, it seems to be working well. Basically here are the changes that only affect emails that either come from a yahoo.com address or are sent to a yahoo.com address. No other email domains [&#8230;]<img alt="" border="0" src="http://pixel.wp.com/b.gif?host=blog.bvcms.com&#038;blog=32746407&#038;post=1163&#038;subd=bvcmsblog&#038;ref=&#038;feed=1" width="1" height="1" />]]></description>
				<content:encoded><![CDATA[<p>We have taken steps to improve deliverability for your emails to and from yahoo.com. This was published yesterday afternoon and so far, it seems to be working well. Basically here are the changes that only affect emails that either come from a yahoo.com address or are sent to a yahoo.com address. No other email domains will work differently than they did before.</p>
<ul>
<li>Let’s take for example an imaginary person, Bob Roberts bobr@yahoo.com.</li>
<li>When Bob receives an email from your bvcms database, <br />the From address for the sender will be “Julia Wood mailer@bvcms.com”<br />Note that it comes from a generic bvcms.com address</li>
<li>If Bob were to reply to the email, <br />it would be addressed to “Julia Wood jwood@fbchurch.org”<br />Note that it goes to her real address </li>
<li>When Bob (who is also a teacher/user of bvcms) sends an email through bvcms<br />the From address  will be &#8220;Bob Roberts mailer@bvcms.com”<br />and the recipients address will be normal </li>
<li>When the recipient replies to Bob’s email, it will go to Bob’s yahoo.com address.</li>
</ul>
<p>So, the only difference is the mailer@bvcms.com address which allows us to get around yahoo’s new policy.</p>
<p>We are continuing to monitor this and want you to let us know if you have any further problems (other than the typical bounces and spam reports).</p><br />Filed under: <a href=''''http://blog.bvcms.com/category/changes/''''>Changes</a>, <a href=''''http://blog.bvcms.com/category/explaining/''''>Explaining</a>  <a rel="nofollow" href="http://feeds.wordpress.com/1.0/gocomments/bvcmsblog.wordpress.com/1163/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/comments/bvcmsblog.wordpress.com/1163/" /></a> <img alt="" border="0" src="http://pixel.wp.com/b.gif?host=blog.bvcms.com&#038;blog=32746407&#038;post=1163&#038;subd=bvcmsblog&#038;ref=&#038;feed=1" width="1" height="1" />]]></content:encoded>
