				<content:encoded><![CDATA[<p>For the time being, <strong>all email going through bvcms to and from emails hosted at yahoo.com will have problems either bouncing or simply not reaching the recipient.</strong></p>
<p>It is not just us! See the article below from <a href="http://blogs.constantcontact.com/fresh-insights/yahoo-bouncing-emails/">Constant Contact</a>.</p>
<p>We are investigating what else we can do, but it is impossible to reach yahoo right now.</p>
<p>We’ll keep you informed as we know more.</p>
