		<description><![CDATA[Check out this new Monthly Meetings Report! You generate it for a group of organizations from the Organization &#62; Search / Manage page. This is a great, easy-to-read report. It contains all the organizations in your list, the attendance for each meeting of the month in addition to the average for the month selected. This [&#8230;]<img alt="" border="0" src="http://pixel.wp.com/b.gif?host=blog.bvcms.com&#038;blog=32746407&#038;post=1158&#038;subd=bvcmsblog&#038;ref=&#038;feed=1" width="1" height="1" />]]></description>
				<content:encoded><![CDATA[<p>Check out this new <strong>Monthly Meetings Report</strong>! You generate it for a group of organizations from the Organization &gt; Search / Manage page.</p>
<p>This is a great, easy-to-read report. It contains all the organizations in your list, the <strong>attendance</strong> for each meeting of the month in addition to the <strong>average</strong> for the month selected.</p>
<p>This is a very quick way for a minister, at the end of the month, to check the attendance for a group of classes for which he is responsible. I like to filter by Program-Division-Schedule, but you can use whatever works for you.</p>
<h3><a href="http://www.bvcms.com/Doc/MeetingsByMonth">Learn more</a></h3><br />Filed under: <a href=''''http://blog.bvcms.com/category/new-features/''''>new features</a>  <a rel="nofollow" href="http://feeds.wordpress.com/1.0/gocomments/bvcmsblog.wordpress.com/1158/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/comments/bvcmsblog.wordpress.com/1158/" /></a> <img alt="" border="0" src="http://pixel.wp.com/b.gif?host=blog.bvcms.com&#038;blog=32746407&#038;post=1158&#038;subd=bvcmsblog&#038;ref=&#038;feed=1" width="1" height="1" />]]></co'',NULL,NULL) WHERE [Url]=N''http://feeds.feedburner.com/BvcmsBlog''
