		<title>Ticketing Attendance – Family Attendance and Status Labels</title>
		<link>http://blog.bvcms.com/2014/04/04/ticketing-attendance-family-attendance-and-status-labels/</link>
		<comments>http://blog.bvcms.com/2014/04/04/ticketing-attendance-family-attendance-and-status-labels/#comments</comments>
		<pubDate>Fri, 04 Apr 2014 17:54:35 +0000</pubDate>
		<dc:creator><![CDATA[Karen]]></dc:creator>
				<category><![CDATA[new features]]></category>

		<guid isPermaLink="false">http://bvcmsblog.wordpress.com/?p=1156</guid>
		<description><![CDATA[We have been tweaking Ticketing Attendance recently for a special use case &#8211; recording individual attendance for a large gathering (such as a worship service) where you have a list of names, not a roll sheet. For example: Everyone attending worship signs a book and passes it down the row. Therefore, the names are in [&#8230;]<img alt="" border="0" src="http://pixel.wp.com/b.gif?host=blog.bvcms.com&#038;blog=32746407&#038;post=1156&#038;subd=bvcmsblog&#038;ref=&#038;feed=1" width="1" height="1" />]]></description>
				<content:encoded><![CDATA[<p>We have been tweaking Ticketing Attendance recently for a special use case &#8211; <strong>recording individual attendance for a large gathering</strong> (such as a <strong>worship service</strong>) where you have a list of names, not a roll sheet. For example: Everyone attending worship signs a book and passes it down the row. Therefore, the names are in no particular order and you must record their attendance by entering each person’s name.</p>
<p>A few months ago, we added <strong>two new features</strong> to this type of attendance recording.</p>
<p>1) Because families typically sit together, one feature is related to recording attendance for family members. Now, when you enter the name and find one family member, we are <strong>displaying the other family members</strong>. And we added <strong>checkboxes</strong> so that you can <strong>mark each one present </strong>without having to find each person individually.</p>
<p>2) We are also now displaying beside the person’s name, their <strong>status as it relates to the organization</strong> &#8211; whether they are a<strong> Member</strong> of the group (organization) or a<strong> Visitor</strong>.</p>
<p><img style="float:left;" title="FamilyAtt.png" src="http://bvcmsblog.files.wordpress.com/2014/04/familyatt.png?w=443&#038;h=169" alt="FamilyAtt" width="443" height="169" border="0" /></p>
<p> </p>
<p> </p>
<p> </p>
<p> </p>
<p> </p>
<p> </p>
<p> </p>
<p>Both of these relate to one of our previous enhancements &#8211; <strong>recording attendance by name using Ticketing Attendance</strong>. If you missed the blog post, click <a href="http://blog.bvcms.com/2013/10/23/ticketing-attendance-new-option-to-record-attendance-by-name/">HERE</a> to read more. Click <a href="http://www.bvcms.com/Doc/TicketingAttendance">HERE</a> for the help article about Ticketing Attendance.</p><br />Filed under: <a href=''''http://blog.bvcms.com/category/new-features/''''>new features</a>  <a rel="nofollow" href="http://feeds.wordpress.com/1.0/gocomments/bvcmsblog.wordpress.com/1156/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/comments/bvcmsblog.wordpress.com/1156/" /></a> <img alt="" border="0" src="http://pixel.wp.com/b.gif?host=blog.bvcms.com&#038;blog=32746407&#038;post=1156&#038;subd=bvcmsblog&#038;ref=&#038;feed=1" width="1" height="1" />]]></content:encoded>
