		<item>
		<title>Happy! Happy! Happy!</title>
		<link>http://blog.bvcms.com/2014/04/02/happy-happy-happy/</link>
		<comments>http://blog.bvcms.com/2014/04/02/happy-happy-happy/#comments</comments>
		<pubDate>Wed, 02 Apr 2014 20:15:15 +0000</pubDate>
		<dc:creator><![CDATA[Karen]]></dc:creator>
				<category><![CDATA[new features]]></category>

		<guid isPermaLink="false">http://bvcmsblog.wordpress.com/?p=1153</guid>
		<description><![CDATA[Sometimes, I just want to blog about something in BVCMS that makes me HAPPY! It isn’t a huge new feature, although it is part of the new user interface that we rolled out earlier this year. It does not dramatically change my methods or processes or work flow. Nor does it make my lunch! It [&#8230;]<img alt="" border="0" src="http://pixel.wp.com/b.gif?host=blog.bvcms.com&#038;blog=32746407&#038;post=1153&#038;subd=bvcmsblog&#038;ref=&#038;feed=1" width="1" height="1" />]]></description>
				<content:encoded><![CDATA[<p>Sometimes, I just want to blog about something in BVCMS that makes me HAPPY! It isn’t a huge new feature, although it is part of the new user interface that we rolled out earlier this year. It does not dramatically change my methods or processes or work flow. Nor does it make my lunch! It is actually something that you might have overlooked.</p>
<p>What is it?</p>
<p>It is the <strong>new search box</strong> at the <strong>top of the drop down lists</strong> on <strong>Search Builder conditions.</strong> I <span style="text-decoration:underline;"><em><strong>love</strong></em></span> this new feature! Most drop downs have just a few options, so it is very easy just to click on the one you want. However, for our church, just selecting a Program or a Division or an Organization can present a very long list. With this new feature, I just type in <strong>Life Groups</strong> or <strong>Women’s Ministry</strong> and I no longer have to scroll down through a bunch of options.</p>
<p>You will probably appreciate this feature the most when you are selecting a <strong>School</strong>, <strong>Employer</strong>, or an <strong>Occupation</strong>. Oh, I almost forgot about <strong>Extra Values</strong>! Most churches will eventually have fairly long lists of these. If what you want to select is near the end of the alphabet (veterinarian for example), you no longer need to scroll down to select it. Just type <em>veterinarian</em> in the search box and it will be right there.</p>
<p>I’ve often said, “It’s the small things in life that can really make me happy.” This is definitely one of those small things that makes me extremely happy and I just had to share that with you.</p><br />Filed under: <a href=''''http://blog.bvcms.com/category/new-features/''''>new features</a>  <a rel="nofollow" href="http://feeds.wordpress.com/1.0/gocomments/bvcmsblog.wordpress.com/1153/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/comments/bvcmsblog.wordpress.com/1153/" /></a> <img alt="" border="0" src="http://pixel.wp.com/b.gif?host=blog.bvcms.com&#038;blog=32746407&#038;post=1153&#038;subd=bvcmsblog&#038;ref=&#038;feed=1" width="1" height="1" />]]></content:encoded>
