		<description><![CDATA[We have not even celebrated Easter; and yet many of you have already begun your preparations for VBS.  There is a lot to do in addition to planning the curriculum: enlisting workers, registering the children, planning the follow-up, and more. We know that you are getting ready, because we get questions from you. “What is the [&#8230;]<img alt="" border="0" src="http://pixel.wp.com/b.gif?host=blog.bvcms.com&#038;blog=32746407&#038;post=1151&#038;subd=bvcmsblog&#038;ref=&#038;feed=1" width="1" height="1" />]]></description>
				<content:encoded><![CDATA[<p>We have not even celebrated Easter; and yet many of you have already begun your <strong>preparations for VBS</strong>. </p>
<p>There is a lot to do in addition to planning the curriculum: enlisting workers, registering the children, planning the follow-up, and more. We know that you are getting ready, because we get questions from you. “What is the best way to set up the online registration?”  “Can or should we use checkin?” </p>
<p>Rather write a blog post answering the questions, we created some <strong>help articles</strong> that you might be interested in reading:</p>
<h3><a href="https://www.bvcms.com/Doc/OnlineRegistrationVBS">General Tips for VBS Registration</a></h3>
<h3><a href="https://www.bvcms.com/Doc/OnlineRegistrationSampleVBS">Sample Registration for Enlisting Workers</a></h3>
<h3><a href="https://www.bvcms.com/Doc/VBSFollowup">VBS Followup Suggestions</a></h3>
<p>We pray that you find these articles helpful and that you have an inspired and fruitful Vacation Bible School this year!</p><br />Filed under: <a href=''''http://blog.bvcms.com/category/uncategorized/''''>Uncategorized</a>  <a rel="nofollow" href="http://feeds.wordpress.com/1.0/gocomments/bvcmsblog.wordpress.com/1151/"><img alt="" border="0" src="http://feeds.wordpress.com/1.0/comments/bvcmsblog.wordpress.com/1151/" /></a> <img alt="" border="0" src="http://pixel.wp.com/b.gif?host=blog.bvcms.com&#038;blog=32746407&#038;post=1151&#038;subd=bvcmsblog&#038;ref=&#038;feed=1" width="1" height="1" />]]></content:encoded>
